import React from 'react';

const styles = {
    root: {
        width: '20%',
        margin: 'auto',
        marginTop: 16,
        padding: 16,
        textAlign: 'left',
        backgroundColor: 'white',
        borderRadius: 16,
    },
    imageContainer: {
        display: 'inline-block',
        width: '50',
    },
    image: {
        width: 50,
        height: 50,
        borderRadius: 25,
    },
    commentContainer: {
        display: 'inline-block',
        marginLeft: 50,
        textAlign: 'left',
        verticalAlign: 'top',
    },
    nameText: {
        color: 'black',
        fontSize: 20,
        fontWeight: '700',
    },
    contentText: {
        color: 'black',
        fontSize: 16,
    }
}


class Comment extends React.Component {
    render() {
        return (
            <div>
                <h1>{'My first component!'}</h1>
            </div>
        )
    }
}

export default Comment;
